اس کا بطور آبجیکٹ تعین کیا جاتا ہے۔ یہ ایک اسپارس ارے ہے جس میں ہر پراپرٹی حرف کا سیٹ کوڈ ہے اور قدر ایک ایسا آبجیکٹ ہے جو بذات خود ایک اسپارس ارے ہے۔ اس اسپارس ارے میں، ہر پراپرٹی وصول کردہ حرف ہے اور قدر ڈسپلے کردہ حرف ہے۔

مثال کے طور پر:
